    with each other in the same reporting period.  The transfers to Non Federal were
    for cash flow purposes and were for administrative expenses.  The voided check
    on Schedule B from Ark. Press Svc. was reversing a payment that was entered into
    the system twice  in error.  The payroll taxes payment was moved to Operating
    expenditures.  There were no upstreams made in connection with  this payment.  These
